  const [state, setstate] = useState()
  const mobileDesk_Subject_Context = createContext({})
  return (
    <>
      <mobileDesk_Subject_Context value = {setstate}>


        {state ? (<CenterMobileMain />
        ) : (<CenterMobileSubject />)}

        </mobileDesk_Subject_Context>
    </>
  );
}
